void drawCar(double angle, int x0, int y0, int dx, int dy, short int colour){
    
    //draws the car body
    for(int carLength = 10; carLength > 0; carLength--){
        int x1 = x0 + carLength*cos(angle + EIGHTHPI);
        int x2 = x0 - carLength*cos(angle + EIGHTHPI);
        int x3 = x0 + carLength*cos(angle - EIGHTHPI);
        int x4 = x0 - carLength*cos(angle - EIGHTHPI);

        int y1 = y0 + carLength*sin(angle + EIGHTHPI);
        int y2 = y0 - carLength*sin(angle + EIGHTHPI);
        int y3 = y0 + carLength*sin(angle - EIGHTHPI);
        int y4 = y0 - carLength*sin(angle - EIGHTHPI);
        draw_line(x1, y1, x3, y3, colour);
        draw_line(x1, y1, x4, y4, colour);
        draw_line(x2, y2, x3, y3, colour);
        draw_line(x2, y2, x4, y4, colour);
        if ((*ptrA9TimerF_bit) == 0 ) { // if timer is not done counting, do nothing
			continue;
		} else if((*ptrA9TimerF_bit) == 1) { // if timer is done counting
			
			(*ptrA9TimerF_bit) = 1; //reset f when done counting
			display();
		}
    }

    //draws the front windshield
    for(int windowLength = 3; windowLength > 0; windowLength--){
        int x1Window = x0 + windowLength*cos(angle + EIGHTHPI + HALFPI) + dx;
        int x2Window = x0 - windowLength*cos(angle + EIGHTHPI + HALFPI) + dx;
        int x3Window = x0 + windowLength*cos(angle - EIGHTHPI + HALFPI) + dx;
        int x4Window = x0 - windowLength*cos(angle - EIGHTHPI + HALFPI) + dx;

        int y1Window = y0 + windowLength*sin(angle + EIGHTHPI + HALFPI) + dy;
        int y2Window = y0 - windowLength*sin(angle + EIGHTHPI + HALFPI) + dy;
        int y3Window = y0 + windowLength*sin(angle - EIGHTHPI + HALFPI) + dy;
        int y4Window = y0 - windowLength*sin(angle - EIGHTHPI + HALFPI) + dy;
        draw_line(x1Window, y1Window, x3Window, y3Window, 0x0);
        draw_line(x1Window, y1Window, x4Window, y4Window, 0x0);
        draw_line(x2Window, y2Window, x3Window, y3Window, 0x0);
        draw_line(x2Window, y2Window, x4Window, y4Window, 0x0);
        if ((*ptrA9TimerF_bit) == 0 ) { // if timer is not done counting, do nothing
			continue;
		} else if((*ptrA9TimerF_bit) == 1) { // if timer is done counting
			
			(*ptrA9TimerF_bit) = 1; //reset f when done counting
			display();
		}
    }

    
}

