void waitForSync(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int status;

    *pixel_ctrl_ptr = 1;

    status = *(pixel_ctrl_ptr + 3);

    while((status & 0x01) != 0){
        if ((*ptrA9TimerF_bit) == 0 ) { // if timer is not done counting, do nothing
			continue;
		} else if((*ptrA9TimerF_bit) == 1) { // if timer is done counting
			
			(*ptrA9TimerF_bit) = 1; //reset f when done counting
			display();
		}
        status = *(pixel_ctrl_ptr + 3);
    }

    
}

