void plot_pixel(int x, int y, short int line_color)
{
	*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

//draws line
void draw_line(int x0, int y0, int x1, int y1, short int line_color){
	
	//checks if slope is too steep
	bool isSteep = abs(y1-y0) > abs(x1-x0);
	
	//if too steep, flip x and y values
	if(isSteep){
		int temp = x0;
		x0 = y0;
		y0 = temp;
		
		temp = x1;
		x1 = y1;
		y1 = temp;
	}
	
	//if x0, is greater than x1, flip the order of x and y
	if(x0 > x1){
		int temp = x0;
		x0 = x1;
		x1 = temp;
		
		temp = y0;
		y0 = y1;
		y1 = temp;
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	int y_step = 0;
	if (y0 < y1){
		y_step = 1; 
	}else{
		y_step = -1;
	}
	
	//plots the points on the line
	for (int x = x0; x < x1+1; x++){
		if (isSteep){
			plot_pixel(y, x, line_color);
		}else{
			plot_pixel(x, y, line_color);
		}
		error = error + deltay;
		if (error >= 0) {
			y = y + y_step;
			error = error - deltax;
		}
	}
}

